    const myTabs = React.createRef<JqxTabs>();

    const [name, setName] = useState('');

    const onShowNameClicked = () => {
        alert('Name is: ' + name);
    };

    const onNameChanged = (e: any) => {
        setName(e.target.value);
    };

    return (
        <JqxTabs>
            <div>aol</div>

        </JqxTabs>
    )
}





export default App;
